import logo from './Logo_vjn.png';
import './App.css';
import Social from './components/socialmedia/Social';

function App() {
  return (
    <div className="App">
      <img src={logo} className="Logo"></img>
      <div className="label">
        <div className="text-wrapper">ABOUT</div>
      </div>
      <div className='Social_div'>
        <Social/>
      </div>
    </div>
  );
}

export default App;
